import { useEffect, useRef, useState } from "react";
import Card from "./Components/Card/card";
import Title from "./Components/Title/title";




const Profile = () => {
    const [date, SetDate] = useState('Today');
    const hideChosingDate = useRef(null);

    function selectDate()
    {
        hideChosingDate.current.focus();
        hideChosingDate.current.click();
    }

    return (
        <div className="grid grid-rows-2 gap-4">
            <div className="grid grid-cols-3 gap-4">
                <Card >1</Card>
                <Card>
                    <Title>patient list</Title>
                    <div>
                        <p>{date}</p>
                        <button onClick={selectDate}>ALO</button>
                        <input ref={hideChosingDate} type="date"></input> 
                    </div>
                </Card>
                <Card>3</Card>
            </div>
            <div className="grid grid-cols-3 gap-4">
                <Card colSpanStyle="col-span-2">4</Card>
                <Card>5</Card>
            </div>
        </div>
    )
}

export default Profile;
